from functools import cache

# works but runs out of memory / stack space
class Solution1:
    def lengthOfLongestSubstring(self, s: str) -> int:

        @cache
        def helper(i, d, cm):
            if i >= len(s):
                return cm 
            
            if d[ord(s[i])] != -1: 
                newd = tuple([-1]*128) 
                return max(cm, helper(d[ord(s[i])] + 1, newd, 0))
            else:
                newd = list(d)
                newd[ord(s[i])] = i
                newd = tuple(newd)
                cm += 1
                return helper(i+1, newd, cm)

        
        defd = tuple([-1]*128)
        return helper(0, defd, 0)

# accepted but slow O(n^2) t, O(n) s
class Solution2:
    def lengthOfLongestSubstring(self, s: str) -> int:
        cm = 0
        i = 0
        while i < len(s):
            j = i   
            lm = 0
            d = {}
            while j < len(s):
                # print("i:", i, "j:", j, "lm:", lm, "cm:", cm, "d:", d)
                if s[j] in d:
                    i = d[s[j]]
                    cm = max(cm, lm)   
                    break
                else:
                    d[s[j]] = i
                    lm += 1
                    cm = max(cm, lm)
                j += 1
                # print("i:", i, "j:", j, "lm:", lm, "cm:", cm, "d:", d)
                # print("---")
            i += 1

        return cm

class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        # sliding window - keep track of the last duplicate and the max window length
        res = 0
        left = 0
        d = {}
        
        for i in range(len(s)):
            # need to check if left <= d[s[i]] otherwise we might move the slider backwards 
            # this would incorrectly grow the range to the left, so only move it if the duplicate is farther right
            if s[i] in d and left <= d[s[i]]:
                # move slider outside of last duplicate
                left = d[s[i]] + 1

            d[s[i]] = i
            res = max(res, i - left + 1)
        return res

 
s = Solution()
print(s.lengthOfLongestSubstring("abcabcbb"), 3)
print(s.lengthOfLongestSubstring("bbbbb"), 1)
print(s.lengthOfLongestSubstring("pwwkew"), 3)
print(s.lengthOfLongestSubstring("aab"), 2)

